  [],\n\t\"revision_timestamp\": \"2015-07-23T03:30:38.080970\",\n\t\"name\": \"quivira-national-wildlife-refuge-annual-narrative-reports-calendar-year-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Quivira
  National Wildlife Refuge summarizes refuge activities during the 1990 calendar year.
  \ The report begins with a summary of the years highlights and climatic conditions.
  \  Land acquisition is also covered.  The report includes a planning section which
  discusses compliance with environmental and cultural mandates, research and investigations.
  \ Refuge administration is outlined; information about personnel, youth programs,
  other manpower programs, volunteer programs, funding, safety, technical assistance,
  and other items is given.  Habitat management is also covered.  Subjects include
  general, wetlands, croplands, grasslands, grazing, fire management, pest control,
  water rights, wilderness and special areas.  The wildlife section of the report
  discusses wildlife diversity, endangered andor threatened species, waterfowl, marsh
  and waterbirds, shorebirds, gulls, terns, and allied species, raptors, other migratory
  birds, games animals, other resident wildlife, fishery resource, animal control,
  marking and banding, and disease prevention and control.  The public uses of the
  refuge described in this report include general, outdoor classrooms students, interpretive
  foot trails, interpretive tour routes, interpretive exhibitsdemonstrations, other
  interpretive programs, hunting, fishing, wildlife observation, other wildlife oriented
  recreation, law enforcement.  The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  energy conservation, and other.  Items of interest are provided at the end.\",\n\t\"license_title\":
